import React, { useEffect, useState } from "react";
import { TextField } from "@material-ui/core";

const initialFieldValue = {
 title: '',
 message: ''
}

//This is a Component PostMessageForm
const PostMessageForm = (props) => {
 const [values, setValues] = useState(initialFieldValue)
 return (
  <form autoComplete="off" noValidate>
   <TextField
    name="title"
    varient="outlined"
    title="Title"
    fullWidth
   >
   </TextField>
   <TextField
    name="message"
    varient="outlined"
    title="Message"
    fullWidth
   >
   </TextField>
  </form>
 );
}

export default PostMessageForm;
